import React from 'react'
import NoteCard from './NoteCard'

const NotesList = (props) => {


    const handleDetails = (param) => {
        props.getDetails(param);

    }


    const RenderNotes = props.passNotesList.map((each) =>{

        return(
            <div className=''>
                <NoteCard key={each.key} passNoteData={each} getDetails={handleDetails}/>
            </div>            
        );
    } )

    return (
        <div align="center" style={{"maxWidth":"90%","display":"gr" ,"grid-template-columns": "repeat(auto-fit, minmax(300px, 1fr))"}}>
            {RenderNotes}
        </div>
    )
}

export default NotesList;
